This enables a web embedder to provide message ports that should be routed to extensions upon their activation.

The embedder API is:

```ts
	readonly messagePorts?: ReadonlyMap<ExtensionId, MessagePort>;
```

The extension API is:

```ts
declare module 'vscode' {
	export interface ExtensionContext {
		readonly messagePort: MessagePort | undefined;
	}
}
```

